private func updateMetrics(
        for request: Request,
        path: String,
        startTime: UInt64,
        statusCode: UInt
    ) {
        let counterDimensions = [
            ("method", request.method.string),
            ("path", path),
            ("status", statusCode.description),
        ]
        Counter(label: "http_requests_total", dimensions: counterDimensions).increment()
